// src/components/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import { fetchEvents, fetchFilteredEvents } from '../services/api';

const AdminDashboard = () => {
    const [events, setEvents] = useState([]);
    const [filteredEvents, setFilteredEvents] = useState([]);
    const [eventType, setEventType] = useState('');
    const [startDate, setStartDate] = useState('');
    const [endDate, setEndDate] = useState('');
    const [currentPage, setCurrentPage] = useState(1);
    const eventsPerPage = 10;

    useEffect(() => {
        const getEvents = async () => {
           // const data = await fetchEvents();
            setEvents([]);
            setFilteredEvents([]);
        };
        getEvents();
    }, []);

    const handleFilter = async () => {
        const data = await fetchFilteredEvents(eventType, startDate, endDate);
        setFilteredEvents(data);
        setCurrentPage(1); // Reset to the first page after filtering
    };

    const handlePageChange = (pageNumber) => {
        setCurrentPage(pageNumber);
    };

    const indexOfLastEvent = currentPage * eventsPerPage;
    const indexOfFirstEvent = indexOfLastEvent - eventsPerPage;
    const currentEvents = filteredEvents.slice(indexOfFirstEvent, indexOfLastEvent);

    const pageNumbers = [];
    for (let i = 1; i <= Math.ceil(filteredEvents.length / eventsPerPage); i++) {
        pageNumbers.push(i);
    }

    return (
        <div className="container">
            <h2>Admin Dashboard</h2>
            <div className="row mb-3">
                <div className="col-md-4">
                    <label>Event Type</label>
                    <input type="text" className="form-control" value={eventType} onChange={(e) => setEventType(e.target.value)} />
                </div>
                <div className="col-md-3">
                    <label>Start Date</label>
                    <input type="date" className="form-control" value={startDate} onChange={(e) => setStartDate(e.target.value)} />
                </div>
                <div className="col-md-3">
                    <label>End Date</label>
                    <input type="date" className="form-control" value={endDate} onChange={(e) => setEndDate(e.target.value)} />
                </div>
                <div className="col-md-2 d-flex align-items-end">
                    <button className="btn btn-primary" onClick={handleFilter}>Filter</button>
                </div>
            </div>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Event Name</th>
                        <th>Event Type</th>
                        <th>Timestamp</th>
                    </tr>
                </thead>
                <tbody>
                    {currentEvents.map((event) => (
                        <tr key={event.id}>
                            <td>{event.id}</td>
                            <td>{event.name}</td>
                            <td>{event.type}</td>
                            <td>{event.timestamp}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <nav>
                <ul className="pagination">
                    {pageNumbers.map(number => (
                        <li key={number} className={`page-item ${currentPage === number ? 'active' : ''}`}>
                            <button onClick={() => handlePageChange(number)} className="page-link">
                                {number}
                            </button>
                        </li>
                    ))}
                </ul>
            </nav>
        </div>
    );
};

export default AdminDashboard;
